import React from 'react';
import './style.css';
const CountriesCorona = ({ data, error }) => {
	console.log(data);
	return (
		<table>
			<thead>
				<tr>
					<th>Country</th>
					<th>NewConfirmed</th>
					<th>TotalConfirmed</th>
					<th>NewDeaths</th>
					<th>TotalDeaths</th>
					<th>NewRecovered</th>
					<th>TotalRecovered</th>
				</tr>
				<tr>
					<th>Country</th>
					<th>NewConfirmed</th>
					<th>TotalConfirmed</th>
					<th>NewDeaths</th>
					<th>TotalDeaths</th>
					<th>NewRecovered</th>
					<th>TotalRecovered</th>
				</tr>
			</thead>
		</table>
	);
};
export default React.memo(CountriesCorona);
